import React, { Component } from 'react'
import 'bootstrap/dist/css/bootstrap.css'

export default class MyNavItem extends Component {
  render() {
    const {iconDate, key} = this.props;
    return (
      <div key={key} className='col-lg-1'>
        <img src={iconDate.iconPath} title={iconDate.title} alt={iconDate.alt} />
      </div>
    )
  }
}
